(32, 'How It Works', '<div class="inner-banner-section">\r\n<div class="container">\r\n<div class="col-sm-12 text-center">\r\n<h1>How It Works</h1>\r\n<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<section class="our-highlights-section">\r\n<div class="container">\r\n<div class="row our-highlights-content">\r\n<div class="col-sm-6">\r\n<h2>Our Highlights</h2>\r\nLorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book.</div>\r\n<div class="col-sm-6"><img src="assets/frontend/img/how-ourhilights-right.jpg" alt="" /></div>\r\n</div>\r\n</div>\r\n</section>\r\n<section class="how-we-work">\r\n<div class="container">\r\n<div class="row">\r\n<div class="col-sm-12">\r\n<h2 class="text-center">How It Works</h2>\r\n</div>\r\n</div>\r\n<div class="row how-we-work-content">\r\n<div class="col-sm-4">\r\n<div class="how-we-heading">01\r\n<h4>Signup</h4>\r\n</div>\r\n<p>Add a focused and productive edge to your study with instant access to our audio-visual notes and exam-material when you sign up for a SimpleStudy account.</p>\r\n</div>\r\n<div class="col-sm-4">\r\n<div class="how-we-heading">02\r\n<h4>Select Subjects</h4>\r\n</div>\r\n<p>Students can choose their subjects in order to start tracking their progress as they complete new topics and exam tasks on our platform.</p>\r\n</div>\r\n<div class="col-sm-4">\r\n<div class="how-we-heading">03\r\n<h4>Study Smart</h4>\r\n</div>\r\n<p>Smart study begins by using our digital homework journal to take note of weekly tasks, while using our carefully curated study notes whenever there is a topic you don&rsquo;t understand.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n<section class="our-mission">\r\n<div class="container">\r\n<h2 class="text-center">Our Mission</h2>\r\n<div class="row">\r\n<div class="col-sm-12 text-center">\r\n<div class="our-mission-content">SimpleStudy wants to change the online education market. We want to help students focus, achieve their potential, and eventually start to ask the right questions. Equally, we want to help digitalise the classroom to allow teachers the data they need to perform at their best. Yet at the core, our project is to innovate the way we teach so that we leave students capable of learning for themselves, a crucial skill that will be of benefit long after school exams. Watch our video to learn more about SimpleStudy and our vision as educators.</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>', '', '{"gjs-assets":"[]","gjs-css":"* { box-sizing: border-box; } body {margin: 0;}.gjs-row{display:table;padding-top:10px;padding-right:10px;padding-bottom:10px;padding-left:10px;width:100%;}.gjs-cell{width:8%;display:table-cell;height:75px;}.our-mission-content{font-family:Times New Roman, Times, serif;font-size:16px;}#i27h{height:459px;}@media (max-width: 768px){.gjs-cell{width:100%;display:block;}}","gjs-styles":"[{\\"selectors\\":[{\\"name\\":\\"gjs-row\\",\\"label\\":\\"gjs-row\\",\\"type\\":1,\\"active\\":true,\\"private\\":1,\\"protected\\":false}],\\"style\\":{\\"display\\":\\"table\\",\\"padding-top\\":\\"10px\\",\\"padding-right\\":\\"10px\\",\\"padding-bottom\\":\\"10px\\",\\"padding-left\\":\\"10px\\",\\"width\\":\\"100%\\"}},{\\"selectors\\":[{\\"name\\":\\"gjs-cell\\",\\"label\\":\\"gjs-cell\\",\\"type\\":1,\\"active\\":true,\\"private\\":1,\\"protected\\":false}],\\"style\\":{\\"width\\":\\"100%\\",\\"display\\":\\"block\\"},\\"mediaText\\":\\"(max-width: 768px)\\",\\"atRuleType\\":\\"media\\"},{\\"selectors\\":[{\\"name\\":\\"gjs-cell30\\",\\"label\\":\\"gjs-cell30\\",\\"type\\":1,\\"active\\":true,\\"private\\":false,\\"protected\\":false}],\\"style\\":{\\"width\\":\\"100%\\",\\"display\\":\\"block\\"},\\"mediaText\\":\\"(max-width: 768px)\\",\\"atRuleType\\":\\"media\\"},{\\"