study with instant access to our audio-visual notes and exam-material when you sign up for a SimpleStudy account.\\\\n        </p>\\\\n      </div>\\\\n      <div class=\\\\\\"col-sm-4\\\\\\">\\\\n        <div class=\\\\\\"how-we-heading\\\\\\">02\\\\n          <h4>Select Subjects\\\\n          </h4>\\\\n        </div>\\\\n        <p>Students can choose their subjects in order to start tracking their progress as they complete new topics and exam tasks on our platform.\\\\n        </p>\\\\n      </div>\\\\n      <div class=\\\\\\"col-sm-4\\\\\\">\\\\n        <div class=\\\\\\"how-we-heading\\\\\\">03\\\\n          <h4>Study Smart\\\\n          </h4>\\\\n        </div>\\\\n        <p>Smart study begins by using our digital homework journal to take note of weekly tasks, while using our carefully curated study notes whenever there is a topic you don&rsquo;t understand.\\\\n        </p>\\\\n      </div>\\\\n    </div>\\\\n  </div>\\\\n</section>\\\\n<section class=\\\\\\"our-mission\\\\\\">\\\\n  <div class=\\\\\\"container\\\\\\">\\\\n    <h2 class=\\\\\\"text-center\\\\\\">Our Mission\\\\n    </h2>\\\\n    <div class=\\\\\\"row\\\\\\">\\\\n      <div class=\\\\\\"col-sm-12 text-center\\\\\\">\\\\n        <div class=\\\\\\"our-mission-content\\\\\\">SimpleStudy wants to change the online education market. We want to help students focus, achieve their potential, and eventually start to ask the right questions. Equally, we want to help digitalise the classroom to allow teachers the data they need to perform at their best. Yet at the core, our project is to innovate the way we teach so that we leave students capable of learning for themselves, a crucial skill that will be of benefit long after school exams. Watch our video to learn more about SimpleStudy and our vision as educators.\\\\n        </div>\\\\n      </div>\\\\n    </div>\\\\n  </div>\\\\n</section>\\",\\"open\\":1}],\\"open\\":1}],\\"open\\":1}]"}', '', '', 1, '2019-01-21 15:33:17', '2019-11-06 05:43:36');
