(29, 'About Us', '<div class="inner-banner-section">\r\n<div class="container">\r\n<div class="col-md-12 text-center">\r\n<h1>&nbsp;</h1>\r\n<div class="inner-banner-section">\r\n<div class="container">\r\n<div class="col-md-12 text-center">\r\n<h1>About Us</h1>\r\n<p>SimpleStudy is an all-inclusive study solution for both Leaving Cert and Junior Cert exams. Our platform offers curated study content alongside organizational and self-assessment tools to ensure that our students stay exam-focused both inside and outside of the classroom.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<section class="about-boxes-wrap">\r\n<div class="container">&nbsp;</div>\r\n</section>\r\n<section class="about-who-section">\r\n<div class="container">\r\n<h2 class="text-center  main-heading heading">Who We Are</h2>\r\n<div class="row who-content-wrap">\r\n<div class="col-md-12">\r\n<p>SimpleStudy was founded by two smart lads from West Cork. Childhood friends, Oisin and Jack share an eclectic set of interests that range from film photography and physics to interior design and micro-economics. Creating a comprehensive online learning platform quickly turned from a weekend project into a growing business venture. Now studying Economics and Architecture respectively, we continue to grow and learn together, and hope to reflect that love of learning in everything we build at SimpleStudy.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n<section class="how-we-do">\r\n<div class="container">\r\n<h2 class="text-center  main-heading heading">What We Do</h2>\r\n<div class="row">\r\n<div class="col-md-12">\r\n<p>At SimpleStudy we are constantly working to enhance the student experience. Equally, we believe our technology can benefit in allowing teachers to innovate so that everyone can benefit from digital learning. No matter your level, we made studying online simple so you can use our platform wherever you are. Don&rsquo;t believe us? Here&rsquo;s how it works!</p>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n</div>\r\n</div>\r\n</div>', '', '{"gjs-assets":"[]","gjs-css":"* { box-sizing: border-box; } body {margin: 0;}.text-center.main-heading.heading{text-align:center;}#ih73{text-align:center;}.gjs-row{display:table;padding-top:10px;padding-right:10px;padding-bottom:10px;padding-left:10px;width:100%;}.gjs-cell{width:8%;display:table-cell;height:75px;}#i3q3j{font-family:Times New Roman, Times, serif;}@keyframes fadeEffect{0%{opacity:0;}100%{opacity:1;}}@media (max-width: 768px){.gjs-cell{width:100%;display:block;}}","gjs-styles":"[{\\"selectors\\":[{\\"name\\":\\"wrapper\\",\\"label\\":\\"wrapper\\",\\"type\\":2,\\"active\\":true,\\"private\\":false,\\"protected\\":false}],\\"wrapper\\":1},{\\"selectors\\":[{\\"name\\":\\"i8w6\\",\\"label\\":\\"i8w6\\",\\"type\\":2,\\"active\\":true,\\"private\\":false,\\"protected\\":false}]},{\\"selectors\\":[{\\"name\\":\\"container\\",\\"label\\":\\"container\\",\\"type\\":1,\\"active\\":true,\\"private\\":false,\\"protected\\":false}]},{\\"selectors\\":[{\\"name\\":\\"col-md-12\\",\\"label\\":\\"col-md-12\\",\\"type\\":1,\\"active\\":true,\\"private\\":false,\\"protected\\":false},{\\"name\\":\\"text-center\\",\\"label\\":\\"text-center\\",\\"type\\":1,\\"active\\":true,\\"private\\":false,\\"protected\\":false}]},{\\"selectors\\":[{\\"name\\":\\"ivf5p\\",\\"label\\":\\"ivf5p\\",\\"type\\":2,\\"active\\":true,\\"private\\":false,\\"protected\\":false}]},{\\"selectors\\":[{\\"name\\":\\"ikhxw\\",\\"label\\":\\"ikhxw\\",\\"type\\":2,\\"active\\":true,\\"private\\":false,\\"protected\\":false}],\\"style\\":{\\"top\\":\\"1px\\",\\"bottom\\":\\"1px\\",\\"right\\":\\"1px\\"}},{\\"selectors\\":[{\\"name\\":\\"iq3zf\\",\\"label\\":\\"iq3zf\\",\\"type\\":2,\\"active\\":true,\\"private\\":false,\\"protected\\":false}]},{\\"selectors\\":[{\\"name\\":\\"text-center\\",\\"label\\":\\"text-center\\",\\"type\\":1,\\"active\\":true,\\"private\\":false,\\"protected\\":false},{\\"name\\":\\"main-heading\\",\\"label\\":\\"main-heading\\",\\